import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function Account(props) {
    let { login } = props;
    console.log(login);


    return (
        <div className="dropdown" >
            <li
                className="nav-item account"
                type="button"
                data-toggle="dropdown"
            >
                <Link to={login ? '/accout' : '/'} className="btn btn-secondary rounded-circle"
                    style={{ 'backgroundImage': 'url("../images/nhan-vien-giao-nhan.png") ' }}>
                    <i className="fa fa-user" />
                </Link>
                <Link
                    className="nav-link text-dark text-uppercase"
                    to={login ? '/accout' : '/'}
                    style={{ display: "inline-block" }}
                >
                    {login ? 'Đăng Nhập' : 'Đăng Xuất'}
                </Link>
            </li>

        </div>
    )
}

export default Account
